(function ($) {
  /**
   * DOM ready
   */


  $(document).ready(function () {
    Drupal.artwork_cart = new Drupal.bk_visita_cart();
    Drupal.artwork_cart.update_buttons();

    $('#reset-visita').click(function (e) {
      e.preventDefault();
      Drupal.artwork_cart.reset();
    });

    $('.visita-action').tooltip({'placement' : 'right'});

    //First render
    Drupal.artwork_cart.render_cart();

    //Cart events suscription
    $.jStorage.subscribe(Drupal.artwork_cart.get_pub_channel(), function (channel, data) {
      Drupal.artwork_cart.overwrite(data.cart, data.cart_map);
      switch (data.action) {
        case "add":
          Drupal.artwork_cart.animate_add(data.item);

          break;
        case "remove":
          Drupal.artwork_cart.animate_remove(data.item.nid);

          break;
        case "reset":
          Drupal.artwork_cart.animate_reset();
          Drupal.artwork_cart.reset_paginate();
          break;
      }
      Drupal.artwork_cart.toggle_empty_message();
      Drupal.artwork_cart.update_buttons();
      Drupal.artwork_cart.update_cart_counter(data.total);
    });
  });


  /**
   * DOM ready FIN
   */
  Drupal.bk_visita_cart = function () {

    var cart = $.jStorage.get('cart', []);
    var cart_map = $.jStorage.get('cart_map', []);
    var wrapper = $('#cart-carousel');
    var wrapper_empty = $('#cart-carousel-empty');
    var paginator_wrapper = $('#carousel-paginator');
    var counter_wrapper = $('#numero-obras');
    var items_per_page = 7;
    var publication_channel = "visita";

    this.get_pub_channel = function () {
      return publication_channel;
    }

    this.toggle_empty_message = function(){
      if(cart_map.length > 0){
        wrapper_empty.hide();
        wrapper.show();
      }else if(cart_map.length==0){
        wrapper.hide();
        wrapper_empty.show();
      }
    }
    /**
     * Cart Management
     */
    this.overwrite = function (new_cart, new_cart_map) {
      cart = new_cart;
      cart_map = new_cart_map;
      this.save();
    }

    this.reload = function () {
      $.jStorage.reInit();
      cart = $.jStorage.get('cart', []);
      cart_map = $.jStorage.get('cart_map', []);
    }

    this.save = function () {
      $.jStorage.set('cart', cart);
      $.jStorage.set('cart_map', cart_map);

    };

    this.add_item = function (item) {
      cart.push(JSON.stringify(item));

      cart_map.push(item.nid + "");
      this.save();
      this.publish('add', item, cart_map.length);
    };

    this.remove_item = function (nid) {
      var key = $.inArray(nid + '', cart_map);

      if (key >= 0) {
        cart.splice(key, 1);
        cart_map.splice(key, 1);
      }
      this.save();
      this.publish('remove', {'nid':nid}, cart_map.length);
    };

    this.reset = function () {
      $.jStorage.deleteKey('cart');
      $.jStorage.deleteKey('cart_map');
      cart = new Array();
      cart_map = new Array();
      this.save();
      this.publish('reset', null, 0);
    };

    this.artwork_exist = function (nid) {
      return ($.inArray(nid + "", cart_map) != -1);
    };

    this.publish = function (action, item, total) {
      var publication = {'action':action, item:item};
      publication.item = item !== null ? item : undefined;
      publication.total = total;
      publication.cart = cart;
      publication.cart_map = cart_map;
      $.jStorage.publish(publication_channel, publication);
    };


    /**
     * RENDER
     */
    this.update_buttons = function () {
      var self = this;
      if(cart_map.length > 0){
        $('#btn-preview-visita').attr('href', '/preparar-visita/'+ cart_map.join(','));
        $('#btn-preview-visita').show();
        if($('#preparar-visita').hasClass('sin-obras')){
          $('#preparar-visita').removeClass('sin-obras');
        }
      }else{
        $('#preparar-visita').addClass('sin-obras');
        $('#btn-preview-visita').attr('href', '#');
        $('#btn-preview-visita').hide();
      }
      $('.visita-action').each(function () {
        var $this = $(this);
        var nid = $this.data('artwork');
        if (self.artwork_exist(nid)) {
          $this.html('<span>-<span class="accesorio"> '+ Drupal.t('Remove from visit') + '</span></span>').addClass('visita-remove').removeClass('visita-add');
        } else {
          $this.html('<span>+<span class="accesorio"> '+ Drupal.t('Add to visit') + '</span></span>').addClass('visita-add').removeClass('visita-remove');
        }
      });
    }

    this.render_cart = function () {
      var items = cart.slice(0);
      var page = 1;
      this.update_cart_counter(cart.length);
      while (items[0] !== undefined) {
        var current_page_items = items.splice(0, items_per_page);
        wrapper.append(this.render_page(page, current_page_items));
        page = page + 1;
      }
      this.toggle_empty_message();
      this.add_paginate();
    };

    this.render_page = function (page, items) {
      var self = this;
      var $container = this._build_page_wrapper(page);
      if (page == 1) {
        $container.addClass("_current");
      } else {
        $container.hide();
      }
      $(items).each(function () {
        var item = JSON.parse(this);
        $container.prepend(self.render_item(item));
      });
      return $container;
    };

    this.render_item = function (item) {
      var small_title = item.title.length > 30 ? item.title.substring(0, 30) + ' ...' : item.title;
      if(item.author != null){
        var small_author = item.author.length > 20 ? item.author.substring(0, 18) + ' ...' : item.author;
      }else{
        var small_author = "";
      }
      var thumb =
        $('<li id="visita-artwork-' + item.nid + '"><article class="thumbnail obra" id="carousel-obra-' + item.nid + '">' +
          '<a href="#" class="eliminar" data-id="' + item.nid + '">' +
          '<span></span>' +
          '</a>' +
          '<div class="imagen no_obras_vertical_align">' +
          '<a href="' + item.url + '">' +
          '<img title="' + item.author + ' : ' + item.title + '" alt="' + item.title + '" src="' + item.image + '">' +
          '</a>' +
          '</div>' +
          '<div class="caption">' +
          '<div class="field-name-field-obra-autor">' +
          '<a href="#">' + small_author + '</a>' +
          '</div>' +
          '<h3 class="titulo"><a href="' + item.url + '">' + small_title + '</a></h3>' +
          '</div>' +
          '</article></li>');

      var eliminar_btn = thumb.find('a.eliminar');
      thumb.hover(function () {
        eliminar_btn.fadeIn(200);
      }, function () {
        eliminar_btn.fadeOut(200)
      });
      eliminar_btn.hide().click(function (e) {
        e.preventDefault();
        var self = new Drupal.bk_visita_cart();
        var nid = $(this).data('id');
        self.remove_item(nid);
      });
      return thumb;
    };

    this._build_page_wrapper = function (page_num) {
      return $('<ul></ul>').addClass('thumbnails').data('page', page_num)
        .attr('id', 'page' + page_num).css('position', 'relative')
        .css('float', 'left');
    }

    this.update_cart_counter = function (num_obras) {
      if (counter_wrapper.html() === "") {
        counter_wrapper.fadeOut(100, function () {
          $(this).html(Drupal.formatPlural(num_obras, Drupal.t('<span>1</span> artwork added to the visit.'),Drupal.t('<span>@count</span> artworks added to the visit.'))).fadeIn(100);

        });
      } else {
        counter_wrapper.fadeOut(100, function () {
          $(this).html(Drupal.formatPlural(num_obras, Drupal.t('<span>1</span> artwork added to the visit.'), Drupal.t('<span>@count</span> artworks added to the visit.'))).fadeIn(100);
        });

      }

      //Outer counter
      this.update_bar_counter(num_obras);
    }

    this.update_bar_counter = function (num_obras) {

      var $wrapper = $('#btn-visita-counter');
      var $actual_item = $wrapper.find('.btn-visita-counter-number');
      var actual_num = $actual_item.data('items');
      actual_num = actual_num >= 0 ? actual_num : 0;
      num_obras = num_obras >= 0 ? num_obras : 0;

      if (num_obras > 0) {
        $wrapper.find('span#counter').addClass('counter-number-active')
      }else{
        $wrapper.find('span#counter').removeClass('counter-number-active')
      }

      if (actual_num < num_obras) {
        this.increase_num_and_move($actual_item, actual_num, num_obras);
      } else {
        this.decrease_num_and_move($actual_item, actual_num, num_obras - 1);
      }
    }

    this.increase_num_and_move = function ($actual, from, to) {
      if (from < to) {
      var self = this;
      from++;
      var $new_number = $('<span></span>').addClass('btn-visita-counter-number').data('items', from).html(from).attr('id', 'btn-visita-number-' + from);
      $actual.after($new_number);
      $actual.animate({'margin-top':'-24px'}, {'duration':Math.round(600 / (parseInt(to) - parseInt(from)+1)), 'queue ':'counter',
        'complete':function () {
          $actual.remove();
          $actual = $new_number;
            self.increase_num_and_move($actual, from, to);
        }});
      }
    }

    this.decrease_num_and_move = function ($actual, from, to) {
      var self = this;
      from--;
      if (from > to) {
        var $new_number = $('<span></span>').css({'margin-top':'-24px'}).addClass('btn-visita-counter-number').data('items', from).html(from).attr('id', 'btn-visita-number-' + from);
        $actual.before($new_number);
        $new_number.animate({'margin-top':'0px'}, {'duration':Math.round(600 / (parseInt(from) - parseInt(to) +1)), 'queue ':'counter',
          'complete':function () {
            $actual.remove();
            $actual = $new_number;
            self.decrease_num_and_move($actual, from, to);
          }});
      }
    }


    this.animate_add = function (item) {
      this._animate_add_reallocate(this.render_item(item), 1);
      this.add_paginate();
    };

    this._animate_add_reallocate = function ($item, page) {
      var self = this;
      var $page = wrapper.find('ul#page' + page);
      var page_items_count = $page.find('li').length;
      if ($page.length == 0) {
        var $new_page = this._build_page_wrapper(page);
        if (page == 1) {
          wrapper.append($new_page);
          $item.cartItemAppendAndFadeShow($new_page, 'prepend', true);
        } else {
          $new_page.append($item.fadeIn());
          $new_page.css('display', 'none');
          wrapper.append($new_page);
        }
      } else {
        if (page_items_count == items_per_page) {
          var $last_item = $page.find('li:last');
          $last_item.fadeOut(200, function () {
            self._animate_add_reallocate($last_item, page + 1);
            $item.cartItemAppendAndFadeShow($page, 'prepend');
          });
        } else {
          $item.cartItemAppendAndFadeShow($page, 'prepend');
        }
      }
    }

    this.animate_remove = function (nid) {
      var $item = $('#carousel-obra-' + nid).parent('li');
      var $page = $item.parent();
      var items_in_page = $item.parent().find('li').length;
      var more_pages = $item.parent().next().length > 0;

      $item.cartItemFadeHideAndRemove();
      if (items_in_page == items_per_page && more_pages) {
        var $next_page = $page.next();
        this.move_from_next_page($page, $next_page);
        this.add_paginate();
      }

    };


    this.move_from_next_page = function ($page, $next_page) {
      var $next_item = $next_page.find('li:first');
      var next_page_have_last_item = $next_page.find('li').length == 1;
      var time = 50;
      var self = this;
      if ($page.is(':visible') || $next_page.is(':visible')) {
        time = 250;
      }
      setTimeout(function () {
        $next_item.cartItemAppendAndFadeShow($page, 'append');
        if (!next_page_have_last_item) {
          var $next_next_page = $next_page.next();
          if ($next_next_page.length > 0) {
            self.move_from_next_page($next_page, $next_next_page);
          }
        } else {
          if ($next_page.is(':visible')) {
            this.goto_page(parseInt(this.get_current_page()) - 1);
          }
          $next_page.remove();

        }
      }, time);
    };

    this.animate_reset = function () {
      wrapper.find('ul').fadeOut(function () {
        $(this).remove()
      });
      this.reset_paginate();
    };

    this.reset_paginate = function () {
      paginator_wrapper.empty();
    };

    this.get_current_page = function () {
      var current_page = wrapper.find('ul:visible');
      if (current_page.length > 0) {
        return current_page.data('page');
      }
      return 0;
    }

    this.add_paginate = function () {
      //this.check_consistency(); //@todo check keys inconsitency

      var self = this;
      paginator_wrapper.empty();

      if (cart_map.length > 7) {
        paginator_wrapper.pagination(Math.ceil(cart_map.length / items_per_page), {
          items_per_page:1,
          num_display_entries:4,
          next_text:Drupal.t('Next'),
          next_show_always:false,
          prev_text:Drupal.t('Previous'),
          prev_show_always:false,
          num_edge_entries:1,

          callback:self.goto_page
        });
      }
    };

    this.goto_page = function (page, pager) {
      page = parseInt(page) + 1;
      var $page = $('#page' + page);
      if (!$page.is(":visible")) {
        if ($('._current', '#cart-carousel').length == 0) {
          $('#cart-carousel').find('ul:visible').fadeOut(function () {
            $page.addClass('_current').fadeIn();
          });
        } else {
          $('._current', '#cart-carousel').removeClass('_current').fadeOut(function () {
            $page.addClass('_current').fadeIn();
          });
        }
      }
    }
  };

  $.fn.cartItemAppendAndFadeShow = function ($target, action, force_animate) {
    var $this = $(this);
    var $article = $this.find('article');

    if (!($.browser.msie) && ($target.is(':visible') || force_animate)) {
      var dimensions = {};
      $article.hide();
      if (action == "prepend") {
        $target.prepend($this);
      } else {
        $target.append($this);
      }
      dimensions = $this.getHiddenDimensions(true);
      $this.css('width', '0px');
      $this.animate({'width':dimensions.width}, function () {
        $article.fadeIn(200);
        $this.css('width', '');
      });
    } else {
      if (action == "prepend") {
        $target.prepend($this);
      } else {
        $target.append($this);
      }
      $this.css('display', 'list-item');//style fix
    }


  }

  $.fn.cartItemFadeHideAndRemove = function () {
    var $this = $(this);
    var $article = $this.find('article');
    $article.fadeOut(200, function () {
      $this.animate({'width':'0px'}, function () {
        $this.remove();
      });
    });
  }
})(jQuery);
