  if (typeof ScrollTrigger !== 'undefined') {

    gsap.registerPlugin(ScrollTrigger);

    var mediaqueryList = window.matchMedia("(min-width: 768px)");

    if (mediaqueryList.matches) {

      var artworkImage = document.querySelector('.js-artwork-image');

      if (document.body.contains(artworkImage)) {
        artworkImage.addEventListener('load', (event) => {
          ScrollTrigger.refresh();
        });
      }
      window.addEventListener('DOMContentLoaded', (event) => {
        var snippetImage = document.querySelectorAll(
          'img.adaptive-image, .artworks-list--sala .artworks-list__row-items img');
        snippetImage.forEach(
          element => element.addEventListener('load', (event) => {
            ScrollTrigger.refresh();
          }));
      });

      let container = document.querySelector(".js-scroll-x-container");
      let scroll_x = document.querySelectorAll(".scroll-x__block");
      let scroll_width = 0;
      scroll_x.forEach(element => scroll_width += element.offsetWidth);

      gsap.to(container, {
        x: () => -(container.scrollWidth -
          document.documentElement.clientWidth) + "px",
        ease: "ease",
        scrollTrigger: {
          trigger: ".scroll-x",
          start: "top top",
          invalidateOnRefresh: true,
          pin: true,
          scrub: 1,
          end: () => 6000,
        }
      });

    }

  }
